"users.level.td.multiuser":{en:"Multiple Users",zh:"多个使用者"},"confirm.template.overwrite":{fr:"Voulez-vous écraser le gabarit existant?",en:"Would you like to overwrite the existing template?",zh:"您愿意覆盖现存模版吗？"},"education.pa2":{en:"Research suggests that there are three types of knowledge acquisition that drawing diagrams can reinforce. First, diagramming trains students to include relevant problem information, and to leave out irrelevant features. Second, it teaches students how to organize the relevant information spatially, and to see and understand proper relationships. Third, students are able to extend the knowledge and understanding represented by one diagram to other analogous situations or problem solving situations. At each stage, teachers can diagnose students' difficulties in gaining the proper understanding and intervene as needed.",
zh:"研究表明，通过绘制图表可以加强对三种类型的知识的获取。首先，图表培养学生使用相关信息来概括问题的能力。其次，它教导学生如何组织有关的信息空间，并明白什么是正确的关系。第三，学生能够扩大对知识面的了解，一个图表所代表的其他类似情况以及相关问题的解决方式。在每一个阶段，教师可以准确的了解到学生的困难，并根据学生需要进行指导。"},"invitations.multiuse":{en:"Multi-use"},"education.pa1":{en:"Drawing diagrams trains students on how to translate written information into visual information, with the opportunity to acquire knowledge during this process through reorganization of information and inference-making.",zh:"绘制图表训练学生如何将书面信息转换至视觉信息。同时也可以使学生在这个推理决策以及重新组织的过程中能够更好的获取知识."},
