"email.collaborators":{en:"Email Collaborators..."},"button.user.add.new":{en:"Add New User",zh:"添加新用户"},"pricing.quote2.content":{fr:"Par le passé, nous devions enregistrer un document sur un lecteur de réseau, l'envoyer par e-mail à tout le monde, gérer différentes versions, et s'assurer que toutes les versions étaient à jour. Avec Lucidchart, on peut voir, partager, et gérer les permissions en même temps. Maintenant, les gens peuvent visualiser les choses de manière simple, plutôt que de lire les 30 pages d'un projet.",
en:"In the past, we had to save a document to a network drive, email it around, manage different versions, and make sure all versions were up to date. With Lucidchart, you can view, share, and manage permissions all at once...Now, people can visualize things in a simple way, rather than reading 30 pages of a project process.",nl:"In het verleden moesten we een document opslaan op een netwerkschijf, het rondmailen, verschillende versies beheren, en ervoor zorgen dat alle versies up-to-date waren. Met Lucidchart kunt u tegelijk bekijken, delen en machtigingen beheren... Nu kunnen mensen dingen visualiseren op een eenvoudige manier, in plaats van het lezen van 30 pagina's van een projectproces.",
pt:"No passado, tínhamos de salvar um documento em uma unidade de rede, enviar por e-mail, gerenciar diferentes versões e nos certificar de que todas estivessem atualizadas. Com o Lucidchart, você pode visualizar, compartilhar e gerenciar permissões de uma só vez... Agora, as pessoas podem visualizar as coisas de forma simples, em vez de ler 30 páginas de um processo de projeto.",de:"Früher mussten wir ein Dokument auf einem Netzlaufwerk abspeichern, es per E-Mail verschicken, verschiedene Versionen verwalten und sicherstellen, dass alle Versionen auf dem neuesten Stand waren. Mit Lucidchart können Sie gleichzeitig betrachten, teilen und Berechtigungen verwalten...Jetzt kann man sich die Dinge ganz einfach visuell erschließen, anstatt sich 30 Seiten Projektprozesse durchzulesen.",
es:"Antes, teníamos que guardar los documentos en una unidad de red, enviarlos por correo electrónico, trabajar con diferentes versiones y asegurarnos de que todas las versiones estuvieran actualizadas. Con Lucidchart, se puede ver, compartir y gestionar los permisos todo a la vez... Ahora se pueden ver las cosas fácilmente, sin tener que leer treinta páginas del proceso de un proyecto."},"userimage.prompt.image.url":{fr:"Veuillez entrer l'adresse URL de l'image",en:"Please enter an image URL",zh:"请输入一个图片网址"},
