"authorize.app.request.heading":{en:"is requesting access to your Lucidchart account"},"ctxpane.style.border.title":{en:"Border"},"text.tabs.stops.label":{en:"Tab stops"},"label.password.new":{en:"New Password",zh:"新密码"},"confirm.document.links.break":{fr:"Cette action va briser tous les liens externes vers ce document.",en:"This will break any outside links to this document.",zh:"这将会终断外部用户进入此文件"},"pricing.faq.collaborate.answer":{fr:"Oui. Chaque type de compte vous permet de collaborer et partager avec d'autres utilisateurs. Cependant, chaque collaborateur est sujet aux limites de son propre compte. Par exemple, les utilisateurs de comptes gratuits ne pourront pas éditer les documents de plus de 60 objets, même si le document est créé par un utilisateur avec un compte professionnel. Les comptes d'équipe permettent aux membres de l'équipe de collaborer avec accès à toutes les caractéristiques les plus développées.",
en:"Yes. Every account level allows you to collaborate and share with others. However, every collaborator is subject to the limitations of their own account. For example, users on free accounts will not be able to edit documents with over 60 objects, even if the document is created by a user on a Professional account. Team accounts allow team members to collaborate with the full set of premium features.",nl:"Ja. Met elk account kunt u samenwerken en delen met anderen. Echter, iedere medewerker is onderworpen aan de beperkingen van hun eigen account. Bijvoorbeeld, zullen de gebruikers op gratis accounts niet in staat zijn om documenten met meer dan 60 objecten te bewerken, zelfs als het document is gemaakt door een gebruiker op een professioneel account. Met team-accounts kunnen teamleden samenwerken met de volledige set van premium-functies.",
pt:"Sim. Cada nível de conta permite colaborar e compartilhar com outros. No entanto, cada colaborador está sujeito às limitações de sua própria conta. Por exemplo, os usuários de contas gratuitas não poderão editar documentos com mais de 60 objetos, mesmo que o documento seja criado por um usuário em uma conta Profissional. Contas de Equipe permitem que os membros da equipe colaborem usando todos os recursos premium.",de:"Ja. Die Zusammenarbeit und das Teilen mit Anderen sind mit jeder Kontenebene möglich. Jeder Mitarbeiter ist jedoch an die Beschränkungen seines jeweiligen Zugangskontos gebunden. Zum Beispiel können Nutzer mit kostenfreiem Zugang keine Dokumente mit über 60 Objekten bearbeiten, selbst wenn das Dokument von einem Benutzer mit einem professionellen Zugangskonto erstellt wurde. Teamkonten ermöglichen Teammitgliedern die Zusammenarbeit mit allen Premiumfeatures.",
es:"Sí. En todos los niveles de cuenta se puede colaborar y compartir con otros. Sin embargo, cada colaborador está sujeto a las limitaciones de su propia cuenta. Por ejemplo, los usuarios de cuentas gratuitas no podrán editar documentos de más de 60 objetos, aunque el documento lo haya creado un usuario con cuenta Profesional. En las cuentas de Equipo, los miembros del equipo pueden colaborar con todas las funcionalidades superiores."},"palettepanel.title":{fr:"Nuancier",en:"Color Palette",zh:"调色板"},
